  def self.parse(location, firm_location_dict=nil)
    found_location = if firm_location_dict&.dig(location)
      firm_location_dict&.dig(location)
    else
      DICT.merge(NON_DUPLICATE_DICT)[location]
    end

    return nil if found_location.nil?

    {
      city: found_location[:city],
      state: found_location[:state],
      country: found_location[:country],
    }
  end
